import React, { useState } from 'react';

function EditPage() {
  const [name, setName] = useState('James Smith');
  const [bio, setBio] = useState('Biography text...');

  return (
    <div id="Blibrary">
      <h1>Annex</h1>
      <div id="picturePart">
        <img src="profile_picture_placeholder.png" alt="Profile" />
        <h2>Name</h2>
        <input type="text" value={name} onChange={(e) => setName(e.target.value)} />
        <h3>Biography</h3>
        <textarea value={bio} onChange={(e) => setBio(e.target.value)} />
        <h2>Updated Name: {name}</h2>
        <h3>Updated Biography: {bio}</h3>
      </div>
    </div>
  );
}

export default EditPage;
